const fzLocal = {
  thermostat_child_lock: {
    cluster: 'hvacUserInterfaceCfg',
    type: ['attributeReport', 'readResponse'],
    convert: (model, msg, publish, options, meta) => {
        const result = {};
        if (msg.data.keypadLockout !== undefined) {
            // Set as child lock instead as keypadlockout
            result.child_lock = msg.data['keypadLockout'] === 1 ? 'Lock' : 'Unlock';
        }
        return result;
    },
  },
  thermostat_sensor_used: {
    cluster: 'hvacThermostat',
    type: ['attributeReport', 'readResponse'],
    convert: (model, msg, publish, options, meta) => {
        const result = {};
        const data = msg.data;
        if (data[attrThermSensorUser] !== undefined) {
            const lookup = {0: 'Inner (IN)', 1: 'All (AL)', 2: 'Outer (OU)'};
            result.sensor = lookup[data[attrThermSensorUser]];
        }
        return result;
    },
  },
  thermostat_operation_mode: {
    cluster: 'hvacThermostat',
    type: ['attributeReport', 'readResponse'],
    convert: (model, msg, publish, options, meta) => {
        const result = {};
        const data = msg.data;
        if (data.programingOperMode !== undefined) {
            const lookup = {0: 'manual', 1: 'programming', 2: 'temporary'};
            result.operation_mode = lookup[data.programingOperMode];
        }
        return result;
    },
  },
  thermostat_deadzone: {
    cluster: 'hvacThermostat',
    type: ['attributeReport', 'readResponse'],
    convert: (model, msg, publish, options, meta) => {
        const result = {};
        if (msg.data.hasOwnProperty('minSetpointDeadBand')) {
          let data;
          if (model.model === model_r06) {
            data = parseFloat(msg.data['minSetpointDeadBand'])/10;
            result.histeresis_temperature = data;
          } else {
            data = parseInt(msg.data['minSetpointDeadBand']);
            result.deadzone_temperature = data;  
          }
        }
        return result;
    },
  },
  thermostat_frost_protect: {
    cluster: 'hvacThermostat',
    type: ['attributeReport', 'readResponse'],
    convert: (model, msg, publish, options, meta) => {
        const result = {};
        if (msg.data.hasOwnProperty(attrThermFrostProtect)) {
          const data = parseInt(msg.data[attrThermFrostProtect]) / 100;
          result.frost_protect = data;
        }
        return result;
    },
  },
  thermostat_heat_protect: {
    cluster: 'hvacThermostat',
    type: ['attributeReport', 'readResponse'],
    convert: (model, msg, publish, options, meta) => {
        const result = {};
        if (msg.data.hasOwnProperty(attrThermHeatProtect)) {
          const data = parseInt(msg.data[attrThermHeatProtect]) / 100;
          result.heat_protect = data;
        }
        return result;
    },
  },
  thermostat_eco_mode: {
    cluster: 'hvacThermostat',
    type: ['attributeReport', 'readResponse'],
    convert: (model, msg, publish, options, meta) => {
        const result = {};
        if (msg.data.hasOwnProperty(attrThermEcoMode)) {
            result.eco_mode = msg.data[attrThermEcoMode] === 1 ? 'On' : 'Off';
        }
        return result;
    },
  },
  thermostat_eco_mode_temperature: {
    cluster: 'hvacThermostat',
    type: ['attributeReport', 'readResponse'],
    convert: (model, msg, publish, options, meta) => {
        const result = {};
        if (msg.data.hasOwnProperty(attrThermEcoModeTemperature)) {
          const data = parseInt(msg.data[attrThermEcoModeTemperature]) / 100;
          result.eco_mode_temperature = data;
        }
        return result;
    },
  },
  display_brightness: {
    cluster: 'genLevelCtrl',
    type: ['attributeReport', 'readResponse'],
    convert: (model, msg, publish, options, meta) => {
      const result = {};
      if (msg.data.hasOwnProperty('currentLevel')) {
        const property = `brightness_${utils.getEndpointName(msg, model, meta)}`;
        //logger.info('property: ' + property);
        return {[property]: msg.data['currentLevel']};
      }
      return result;
    },
  },
  thermostat_frost_protect_onoff: {
    cluster: 'hvacThermostat',
    type: ['attributeReport', 'readResponse'],
    convert: (model, msg, publish, options, meta) => {
        const result = {};
        if (msg.data.hasOwnProperty(attrThermFrostProtectOnOff)) {
            result.frost_protect_on_off = msg.data[attrThermFrostProtectOnOff] === 1 ? 'On' : 'Off';
        }
        return result;
    },
  },
  thermostat_brightness_level: {
    cluster: 'hvacThermostat',
    type: ['attributeReport', 'readResponse'],
    convert: (model, msg, publish, options, meta) => {
        const result = {};
        const data = msg.data;
        if (msg.data.hasOwnProperty(attrThermLevel)) {
            const lookup = {0: 'Off', 1: 'Low', 2: 'Medium', 3: 'High'};
            result.brightness_level = lookup[data[attrThermLevel]];
        }
        return result;
    },
  },
  thermostat_sound: {
    cluster: 'hvacThermostat',
    type: ['attributeReport', 'readResponse'],
    convert: (model, msg, publish, options, meta) => {
        const result = {};
        if (msg.data.hasOwnProperty(attrThermSound)) {
            result.sound = msg.data[attrThermSound] === 1 ? 'On' : 'Off';
        }
        return result;
    },
  },
  thermostat_inversion: {
    cluster: 'hvacThermostat',
    type: ['attributeReport', 'readResponse'],
    convert: (model, msg, publish, options, meta) => {
        const result = {};
        if (msg.data.hasOwnProperty(attrThermInversion)) {
            result.inversion = msg.data[attrThermInversion] === 1 ? 'On' : 'Off';
        }
        return result;
    },
  },
  thermostat_schedule_mode: {
    cluster: 'hvacThermostat',
    type: ['attributeReport', 'readResponse'],
    convert: (model, msg, publish, options, meta) => {
        const result = {};
        const data = msg.data;
        if (msg.data.hasOwnProperty(attrThermScheduleMode)) {
            const lookup = {0: 'Off', 1: '5+2', 2: '6+1', 3: '7'};
            result.schedule_mode = lookup[data[attrThermScheduleMode]];
        }
        return result;
    },
  },
  thermostat_schedule: {
    cluster: 'hvacThermostat',
    type: ['commandSetWeeklySchedule'],
    convert: (model, msg, publish, options, meta) => {
      const result = {};
      const { data } = msg;
      const daysOfWeekNums = [...Array(7).keys().filter((x) => 2**x & data.dayofweek)];
      const schedule = `${data.transitions.map(t => `${String(Math.floor(t.transitionTime/60)).padStart(2, '0')}:${String(t.transitionTime%60).padStart(2, '0')}/${t.heatSetpoint/100.0}°C`).join(' ')}`;
      const daysOfWeek = ['sunday', 'monday', 'tuesday', 'wednesday', 'thursday', 'friday', 'saturday'];
      daysOfWeekNums.map((d) => daysOfWeek[d]).forEach((dow) => { result[`schedule_${dow}`] = schedule; } );
      return result;
    },
  },
};


